import React from "react";
import FreeBoard from "./components/FreeBoard/FreeBoard";

const App = (props) => {
  return (
    <>
      <div className="w-auto relative min-h-full max-w-480 mx-auto bg-white shadow-md text-gray-800">
        <FreeBoard />
      </div>
    </>
  );
};

export default App;
